static const struct FontInfo* fontsPrvGetFont(enum Font which)
{
	const struct FontInfo *fonts[] = {
		[FontSmall] = &smallFont,
		[FontMedium] = &century_10ptFont,
		[FontLarge] = &comicSansMS_13ptFont,
	};

	if ((unsigned)which >= sizeof(fonts) / sizeof(*fonts))
		return NULL;

	return fonts[which];	//may be NULL
}

uint_fast8_t fontGetHeight(enum Font which)
{
	const struct FontInfo *fi = fontsPrvGetFont(which);

	return fi ? fi->fontHeight : 0;
}

bool fontGetGlyphInfo(struct FontGlyphInfo *glyph, enum Font which, wchar_t ch)
{
	const struct FontInfo *fi = fontsPrvGetFont(which);
	uint_fast8_t i, j;

	if (!fi)
		return false;

	if (ch == ' ') {
		glyph->src = NULL;
		glyph->width = fi->spaceWidth;
		glyph->height = fi->fontHeight;
		return true;
	}
	
	if (ch == THINSPACE) {	//thin space
		glyph->src = NULL;
		glyph->width = fi->thinSpaceWidth;
		glyph->height = fi->fontHeight;
		return true;
	}

	for (j = 0; j < 2; j++, ch = MISSINGCHAR) {	//second pass searches for missing char

		for (i = 0; i < fi->numSlices; i++) {
			if (ch >= fi->slice[i].firstChar && ch <= fi->slice[i].lastChar) {
				
				const uint16_t *ofstP = &fi->slice[i].offsets[ch - fi->slice[i].firstChar];
				uint32_t thisOfst = *ofstP++;
				uint32_t nextOfst = *ofstP++;
				uint32_t charWidth = (nextOfst - thisOfst) / ((fi->fontHeight + 7) / 8);


				glyph->src = fi->slice[i].data + thisOfst;
				glyph->width = charWidth;
				glyph->height = fi->fontHeight;

				///get info
				return true;
			}
		}
	}

	//we should not get here sice missing char should always exist
	return false;
}

bool fontGetGlyphPixel(const struct FontGlyphInfo *glyphInfo, uint_fast8_t row, uint_fast8_t col)
{
	const uint8_t *src = glyphInfo->src;

	if (row >= glyphInfo->height || col >= glyphInfo->width)
		return false;

	if (!src)
		return false;

	//horiz position
	src += col;

	//vert position
	src += row / 8 * glyphInfo->width;

	return 1 & (*src >> (row % 8));
}






